script: |
  super -f text -I q11100.spq | sort > q11100.out

inputs:
  - name: q11100.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE 14 * col0 NOT BETWEEN - + CAST ( NULL AS REAL ) * + col2 / - col2 AND 5;
  - name: tab1

outputs:
  - name: q11100.out
    data: |
      51	14	96
      85	5	59
      91	47	68
